import React from 'react';
import logo from '../assests/log.png';
import '../App.css';


import { Link } from "react-router-dom";

function LogoutNow() {
  alert("You have Successfully Logged Out. Hope to see you again.")
  localStorage.removeItem("IsSignIn");
  window.location.reload();
}

function Nav({IsSignIn, setIsSignIn}) {
  
	return (
<>
    {IsSignIn ? (

  <>
  <nav className="header">
  <a href="./"><img src={logo} className="logo" alt=""></img></a>
  
  <div className="menu-btn" ></div>
 
	
  <ul>
  <li><a href="../">Home</a></li>
    <li><a href="../about">About</a></li>
    <li><a href="../careers">Careers</a></li>
    <li><button onClick={LogoutNow} >Logout</button></li>

  </ul>


</nav>
</>
      ) : (

		<>
		<body>
    <nav >
    
  <a href="./"><img src={logo} className="logo" alt=""></img></a>
  <input type ="checkbox" id ="click"></input>
  <label htmlFor="click" className="menu-btn" >
  <i className="fas fa-bars"></i></label>
  
  <ul >
  <li><a href="/">Home</a></li>
    <li><a href="/about">About</a></li>
    <li><a href="./careers">Careers</a></li>
  
   <li className="login-btn"><a href="./register">Register</a></li>
   
   
  </ul>
    </nav>
    <div className="content">
    <div>Your Smart Financial Planner</div>
    <div className="btn">
        <button type="submit" to="./register"><Link to="./register">PLAN NOW</Link></button>
        </div>

    </div>
    </body>

</>

      )}
</>
		)
};

export default Nav;
